import React from 'react';

const BrowserHeader = () => {
  return (
    <header className="bg-black text-white fixed w-full z-50">
      <div className="flex items-center justify-between p-4">
        {/* Logo */}
        <div className="text-xl font-bold">
          <span className="text-red-600">Net</span>flix
        </div>

        {/* Navigation links */}
        <div className="hidden md:flex space-x-6">
          <a href="/" className="hover:text-gray-300">Home</a>
          <a href="/tv-shows" className="hover:text-gray-300">TV Shows</a>
          <a href="/movies" className="hover:text-gray-300">Movies</a>
          <a href="/new" className="hover:text-gray-300">New & Popular</a>
          <a href="/my-list" className="hover:text-gray-300">My List</a>
        </div>

        {/* Right section: user avatar or profile actions */}
        <div className="flex items-center space-x-4">
          <a href="/search" className="hover:text-gray-300">Search</a>
          <a href="/notifications" className="hover:text-gray-300">Notifications</a>
          <div className="relative">
            <img
              src="https://www.pngall.com/wp-content/uploads/5/Profile-PNG-Image.png" // Change to your profile image
              alt="User Avatar"
              className="w-8 h-8 rounded-full cursor-pointer hover:ring-2 hover:ring-red-600"
            />
            {/* Dropdown menu could go here */}
          </div>
        </div>
      </div>

      {/* Add a small banner below the header for the background effect */}
      <div className="absolute top-0 left-0 right-0 h-20 bg-gradient-to-b from-black to-transparent"></div>
    </header>
  );
};

export default BrowserHeader;
